import { Link } from 'react-router-dom';

function NavBar() {
    return (
        <>
            <nav className='navbar'>
                <div className='navbar-container'>
                    <Link to='/' className='navbar-logo'>
                    MLTC <i className= 'fab.fa-typo3'/>
                    </Link>
                </div>
            </nav>
        </>

    )
}

export default NavBar
